import React, { useEffect } from 'react';
import OpenAI from 'openai';

function App() {
  useEffect(() => {
    // OpenAI API 초기화
    const openai = new OpenAI({
      apiKey: "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", // 본인의 OpenAI API 키로 대체
      dangerouslyAllowBrowser: true, // 브라우저 환경에서 실행 허용
    });

    // 엔진 목록 가져오기
    openai.listEngines()
      .then(response => {
        console.log('사용 가능한 엔진 목록:', response.data);
      })
      .catch(error => {
        console.error('API 호출 오류:', error);
      });
  }, []);

  return (
    <div className="App">
      {/* 앱의 내용 */}
    </div>
  );
}

export default App;
